import { NavLink } from 'react-router-dom';
import { Outlet } from 'react-router-dom';
import { Div, HLink, Name } from './AppBar.styled';

const AppBar = () => {
  return (
    <>
      <header>
        <h1>Delivery</h1>
        <Div>
          <HLink to="/devoveryApp">Home</HLink>
          <HLink to="card">Shop Card</HLink>
        </Div>
      </header>
      <Outlet />
    </>
  );
};

export default AppBar;
